@komatsuglobal, a prominent manufacturer in the global construction and mining equipment sector based in Japan, has launched the second generation of its Z2 product line. This new iteration includes battery-electric versions of the ZJ21 jump drill and ZB21 bolter, catering to the small-class segment.

#Innovation #MiningTech #Construction #Drill #Electric #EV
Read about it and more: http://www.constructionhq.world/issue-sections/construction-machines-vehicles/earthmoving-equipment/komatsu-introduces-second-generation-battery-electric-drillers-and-bolters/

